# plotting the missing map
def missing_map(data, color, title = "Missing map"):
    # missing map from missingno
    plot = msno.matrix(data, color=color)
    # adding the title
    plot.set_title(title, fontsize = 40, weight = "bold")
    # making the plot
    plt.show()

